// Get AI output JSON safely (works even if wrapped in array)
const raw = $json["output"] || ($json[0] && $json[0].output);
if (!raw) {
  throw new Error("No valid output data found in input");
}

const studentName = raw["Student Name"];
const examinerName = raw["Examiner Name"];
const totalCorrect = raw["Total Correct Answers"];
const totalIncorrect = raw["Total Incorrect Answers"];
const totalMarks = raw["Total Marks"];
const marksObtained = raw["Marks Obtained"];

const questions = raw["Data"] || [];

const result = questions.map(q => ({
  json: {
    "Student Name": studentName,
    "Examiner Name": examinerName,
    "Question": q["Question"],
    "Correct Answer": q["Correct Answer"],
    "Student Answer": q["Student Answer"],
    "Status": q["Status"],
    "Total Correct Answers": totalCorrect,
    "Total Incorrect Answers": totalIncorrect,
    "Total Marks": totalMarks,
    "Marks Obtained": marksObtained
  }
}));

return result;
